    [],nt"revision_timestamp": "2016-07-27T23:06:03.686333",nt"name": "conboy-lake-bullfrog-and-bullhead-control",nt"isopen":
    false,nt"url": null,nt"notes": "This proposal is to support two AmeriCorps
    interns for 24 weeks to work on removal of American bullfrogs and brown bullhead
    to benefit Oregon spotted frogs, a federally listed species, at Conboy Lake National
    Wildlife Refuge. Over the past several years, Refuge staff have been experimenting
    with control methods for bullfrogs and brown bullhead, both invasive aquatic species.
    In 2015, we began a concerted effort using fyke nets, although on a somewhat limited
    basis due to staffing. The fyke nets proved to be a successful method for collecting
    bullfrogs and bullhead, and seem to have promise as a method for controlling these
    invasive species for the benefit of Oregon spotted frogs. A second year of sustained
    effort using fyke nets is necessary to more thoroughly evaluate the effectiveness
    of the method by analyzing changes to population structure and catch rates of bullfrogs
    and bullhead in Year 2. This data analysis will be conducted with the assistance
    of USGS biologists under an SSP grant, which has already been secured. With additional
    staffing, we can also broaden the effort to the entire refuge, which is 6,300 acres
    total. Without additional staffing, we will be unable to put adequate effort into
    bullfrog and bullhead removal and will not appropriately leverage the SSP-funded
    study.Fyke net sampling will occur from early May through early October. Seven nets
    will be set four nights per week. Fyke net removal of invasive species is covered
    under an existing section 10 permit for Oregon spotted frogs.",nt"license_title":
